import React from 'react';
import Header from './Header';
import '../App.css';
import Footer from './Footer';


const Wsocial = () => {
    return (
        <div>
            <Header />
            <div className="centerContainer">
                <p>
                    
                    Today we are upto date with social media but for growing in life we have learn news things
                     in life so that we can grow to slove this we are presenting video & audio ,blogs , vlogs
                      ( travel video ) app for your earnings so learn top creator around world download your indo media app
                </p>
                <p>
                Indonesia social ,usa social ,uk social , japan Yahoo, Yahoo , science , social media app , 
                social networking app , German video , French video , euro news ,world news ,time news , bbc 
                international news ,bbc Hindi ,aaj tak , india news ,india tv ,jio tv , news channel , online news ,
                current affairs, updates video and blogs
                </p>
                <p>
                From best-selling fiction, sci-fi and crime to celebrity biographies, kids’ books and self-help,
                 we’ll help you build a library you’ll be listening to for years to come. Read by some of the world’
                 s best loved voices, every audio story is yours to stream, download
                </p>
            </div>
            <Footer />
        </div>
    );
}

export default Wsocial;
